import React from 'react'
import styled from 'styled-components'
import { RootStateOrAny, useSelector } from 'react-redux'
import {data} from '../marker'
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';


const style = {
  width: '50%',
  height: '100%'
}
console.log(data)
function Maps(props:any) {
  const state = useSelector((state: RootStateOrAny) => state.showMap)
  console.log(state)
  return (
    <MapDisplay toggle={state}>
         <Map
          google={props.google}
          style={style}
        initialCenter={props.google.maps.LatLng()}
      >
        <Marker name={'Dolores park'}
    position={{lat: 37.759703, lng: -122.428093}} ></Marker>
        </Map>
    </MapDisplay>
  )
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCu596cFThiki-PpBwubeJAT8l89tgPh78'
})(Maps)

const MapDisplay = styled.div<{ toggle: Boolean }> `
width:${((props) => props.toggle ? '50%' :'0' )};
`
